import React, { useEffect, useState } from "react";
import "./DisplayTeddies.css";
import NavBar from "../Nav/Nav";

import axios from "axios"


const URL = "http://Localhost: 5000/items"

const fetchHandler = async ()=>{
    return await axios(URL).then((res)=>res.data);
}




function DisplayTeddies(props) {
    const [items,setItems]= useState();

    useEffect(()=>{
        fetchHandler().then((data)=>setItems(data.items));
    },[])
    const[_id,itemname,getprice, sellprice, pices, date] = props.item;
    
  return (
    <div className="wrapper clearfix">
      <NavBar />
      <div>
            {items && items.map((item,i)=>(
                <div key = {i}>
                    <DisplayTeddies item ={item}/>
                    </div>
            ))}
        </div>
      <h1>Teddy Bares</h1>
      <div className="category">
      <div className="sub-category">
        <h2>Brown Teddy : {itemname}</h2>
        
      </div>
      <div className="sub-category">
        <h2>Black Teddy {getprice}</h2>
      </div>
      <div className="sub-category">
        <h2>Yello Teddy {sellprice}</h2>
      </div>
      <div className="sub-category">
        <h2>Pink Teddy {pices}</h2>
      </div>
    </div>
    </div>
  );
}

export default DisplayTeddies;
